using Dtos;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Xunit;

namespace MailMeUpTestMeUp
{
    public class SendMail : SuperUnitTest
    {
        [Theory]
        [MemberData(nameof(Data))]
        public async Task SendMailTest(LoginDto dto, MailDto mailDto, bool succesfullRequest)
        {
            var token = await Login(dto.Username, dto.Password);
            Assert.Equal(succesfullRequest, !string.IsNullOrEmpty(token));
            if (!string.IsNullOrEmpty(token))
            {
                var response = await _lib.SendEmail(mailDto, token);
                Assert.NotNull(response);
                Assert.Equal(succesfullRequest, response.StatusCode == System.Net.HttpStatusCode.OK);
                Assert.Equal(succesfullRequest, response.Success);
                Assert.Equal(succesfullRequest, string.IsNullOrWhiteSpace(response.ErrorMessage));
                if (response.Success)
                {
                    Assert.NotNull(response.Data);
                    Assert.Equal(succesfullRequest, response.Data.Success);
                    Assert.Equal(succesfullRequest, string.IsNullOrWhiteSpace(response.Data.ErrorMessage));
                }
                var logoutResult = await Logout(token);
                Assert.Equal(!string.IsNullOrEmpty(token), logoutResult);
            }
        }

        public static IEnumerable<object[]> Data =>
        new List<object[]>
        {
            new object[] { new LoginDto() { Username = "Boss", Password = "Boss" }, new MailDto()
            {
                Body="Hello",
                Subject="Test",
                IsBodyHtml=false,
                To=new List<string>(){ "podothedeveloper@gmail.com" },
                Attachments = new List<MailMeUpAttachmentDto>(){
                    new MailMeUpAttachmentDto("Test Doc","test.txt",false), 
                    new MailMeUpAttachmentDto("VGVzdCBEb2M=","test.pdf",true),
                    new MailMeUpAttachmentDto("","test.docx",true),
                }
            },true }
        };
    }
}
